import React, { useState, useEffect } from "react";
import { Link, NavLink } from "react-router-dom";
import axios from "axios";
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Navbar, Nav } from "react-bootstrap";
function UserProfile() {
  //   function logOut() {
  //     localStorage.clear();
  //     navigate('/');
  // }

  const [userInfo, setUserInfo] = useState({});
  useEffect(() => {
    const storedUserInfo = localStorage.getItem("user-info");

    if (storedUserInfo) {
      const parsedUserInfo = JSON.parse(storedUserInfo);
      setUserInfo(parsedUserInfo[0]);
    }
  }, []);
  const handleSubmit = (event) => {
    event.preventDefault();
  };

  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary">
        <Container>
          <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
              <NavDropdown title="Dropdown" id="basic-nav-dropdown">
                <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
                <NavDropdown.Item href="#action/3.2">
                  Another action
                </NavDropdown.Item>
                <NavDropdown.Item href="#action/3.3">
                  Something
                </NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item href="#action/3.4">
                  Separated link
                </NavDropdown.Item>
              </NavDropdown>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <h1>User Profile</h1>
      {userInfo ? (
        <div action="" onSubmit={handleSubmit}>
          <p>Name: {userInfo.first_name}</p>
          <p>Email: {userInfo.last_name}</p>
          <p>Email: {userInfo.address}</p>
          <p>Email: {userInfo.phone_Number}</p>
          <p>Email: {userInfo.email}</p>
          <p>Email: {userInfo.birthdate}</p>
          {/* Display other user-specific data */}
        </div>
      ) : (
        <p>Loading user data...</p>
      )}
    </div>
  );
}

export default UserProfile;
